import ItemLink from "../shared/components/ItemLink"

const HeaderBottom = () => {
    const navigationList = [
        {
            href: "link",
            content: "Главная"
        },
        {
            href: "link",
            content: "Компания"
        },
        {
            href: "link",
            content: "Каталог"
        },
        {
            href: "link",
            content: "Новости"
        },
        {
            href: "link",
            content: "Спецпредложения"
        },
        {
            href: "link",
            content: "Доставка"
        },
        {
            href: "link",
            content: "Контакты"
        },
    ]

    return (
        <div className="header-bottom">
            <nav className="header-bottom-navigation">
                <ul className="header-bottom-navigation-list">
                    <ItemLink className={"header-bottom-navigation-list-item"} href={"link"} content={"Главная"}></ItemLink>
                    <li className="header-bottom-navigation-list-item"><a href="link">Компания</a></li>
                    <li className="header-bottom-navigation-list-item"><a href="link">Каталог</a></li>
                    <li className="header-bottom-navigation-list-item"><a href="link">Новости</a></li>
                    <li className="header-bottom-navigation-list-item"><a href="link">Спецпредложения</a></li>
                    <li className="header-bottom-navigation-list-item"><a href="link">Доставка</a></li>
                    <li className="header-bottom-navigation-list-item"><a href="link">Контакты</a></li>
                </ul>
            </nav>
        </div>
    )
}

export default HeaderBottom
